Custom Actions are simply functions returning Action . package action import ( "path/filepath" "github.com/carapace-sh/carapace" "github.com/carapace-sh/carapace/pkg/style" "github.com/carapace-sh/freckles/pkg/freckles"
) func ActionFreckles() carapace.Action { return carapace.ActionCallback(func(c carapace.Context) carapace.Action { vals := make([]string, 0) freckles.Walk(func(freckle freckles.Freckle) error { vals = append(vals, freckle.Path) return nil }) return carapace.ActionValues(vals...).MultiParts("/").StyleF(func(s string, sc style.Context) string { return style.ForPath(filepath.Join(freckles.Dir(), s), sc) }) })
} There are two main phases in Carapace : The creation of the command structure and registration of completions. The parsing of the command line and invocation of the corresponding Action . carapace.Gen(initCmd).PositionalCompletion( carapace.ActionValues(initCmd.Flag("clone").Value.String()), // (1) completes the default value carapace.ActionCallback(func(c carapace.Context) carapace.Action { return carapace.ActionValues(initCmd.Flag("clone").Value.String()) // (2) completes the parsed value }),
) Custom Actions should almost always be wrapped in ActionCallback so code is only executed when invoked. The Default Actions do this implicitly. The Walk function returns dotfiles with their full path within the repository: path/to/file. By modifying the Action with MultiParts the segments get completed separately. Additionally, style.ForPath highlights them with the style defined by the LS_COLORS environment variable.

